function DicoverCards({ data }) {
  const { name, title, avatar, img, price, bid } = data;
  return (
    <div className="discover-card">
      <img src={img} alt={title} />
      <div className="discover-deets">
        <h2>{title}</h2>
        <p></p>
      </div>
    </div>
  );
}

export default DicoverCards;
